      "m_uiMesSvrID" : 8872806442048028579,
      "m_nsContent" : "妞妞刚来家里没多久时，有次逛街我想买块地毯，到了商场问售货员地毯区在哪儿，她说你买地毯干嘛？我说养了宠物，想在地上有块儿能躺的地方，她听了直摇头，说千万不能买，一是粘毛特别容易脏，二是很难打理，不如买个塑料垫子，于是我就在她的带领下买了塑料垫子。直到后来，我还是很想买地毯，无论如何我都想试一下，因为我觉得喜欢，很温馨，于是就买了。地毯太舒服了，我只恨买晚了。现在我恨不得把全家都铺满地毯，并且地毯用吸尘器的话一点也不难打理，跟妞端躺在地毯上是我最最快乐的时光。\n    我眼睛不好，弱视。之前其实已经很少用电脑了，因为看一会儿，就特别疲劳，整个眼酸胀。后来我想，不如我换一块大点的显示器试试吧，字体大点图像大点看起来兴许能轻松点，于是我买了一块43寸的。安装师傅来到家里时，惊了，看到我买了这么大一块显示器说你疯啦？！就这么点距离你不嫌仰的脖子疼啊？这看起来肯定很不舒服啊，趁没拆封你不如退了……我一下子纠结了，他应该是真的为我好，他来都来了装一下也不麻烦，可能是真觉得太大了怕我用起来难受。但我懒得退了，潜意识里，我还是想试一下看，想来想去还是装了。装好后有两天我都没开机，因为被他这么一说我心里的期待少了很多，甚至刚开机用的时候，还在忐忑。现在我已经用了两个月了，怎么说呢？还好当时坚持了一下，装了，太舒服了！真的！字体大了！图像大了！眼睛轻松了很多，看清了很多，我甚至又想对着它写点东西了。\n    上次去吃涮羊肉，我跟爸坐下，点完菜，菜刚上来，隔壁桌的阿姨（我俩只隔了一个半米高的挡板）指着我们点的羊肉说：哎呀这个可膻了，你看，我们就只吃了一半，吃不下了，你们尝尝，一点也不好吃。我说没事儿，每个人口味不一样吧也许。我跟爸吃我们的，羊肉很新鲜，肥瘦均匀入口即化，我们蘸着小料吃的很开心，甚至还加了两盘。吃到后面，我又点了一盘糖蒜，端上来时那阿姨又指着说：这个可酸了，吃完嘴又臭，你们爱吃这个？！我说：我今晚也没打算跟谁接吻，咱各自管好自己行吗？我就想吃。\n    大家遇到自己喜欢的东西，就别太在乎别人的意见了。能在这世上喜欢点什么真的是福分，不要被别人轻易打扰了这份欢喜。"
